import React, { useState } from 'react';
import axios from 'axios';
import Head from 'next/head';

import Menu from '../components/Menu';

import {
    Container,
    Jumbotron,
    Button
} from 'reactstrap';

import 'bootstrap/dist/css/bootstrap.min.css';

import { library } from '@fortawesome/fontawesome-svg-core';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { fas } from '@fortawesome/free-solid-svg-icons';

library.add(fas);

const Home = (data) => (
    <div>
        <Head>
            <title>Home - Celke</title>
            <meta name="description" content="Site de ... sobre ..." />
            <meta name="author" content="Celke" />
        </Head>
        <Menu />
        <Jumbotron fluid className="descr-top">
            <style>{`.descr-top{
                    background-color: #000;
                    color: #fff;
                    padding-top: 150px;
                    padding-bottom: 100px;
                    margin-bottom: 0rem !important;
                    position: relative;
                }.inicio-link{
                    position: absolute;
                    top: -0px;
                }`}</style>
            <Container className="text-center">
                <a name="inicio" className="inicio-link"></a>
                <h1 className="display-4 mb-4"> { data } </h1>
                <p className="lead mb-4">This is a simple hero unit, a simple Jumbotron-style component for calling extra attention to featured content or information.</p>
                <p className="lead">
                    <Button outline color="warning" size="lg">ENTRE EM CONTATO</Button>
                </p>
            </Container>
        </Jumbotron>

        <Jumbotron fluid className="servicos">
            <style>{`.servicos{
                background-color: #fff;
                padding-top: 80px;
                padding-bottom: 80px;
                margin-bottom: 0rem !important;
                position: relative;
            }.circulo{
                width: 140px;
                height: 140px;
                background-color: #fed136;
                font-size: 52px;
                padding-top: 24px;
                color: #fff;
            }.centralizar{
                margin: 0 auto !important;
                float: none !important;
            }.servico-link{
                position: absolute;
                top: -0px;
